import unittest
from pprint import pprint
import pdb

class Solution:
    # @return an integer
    def lengthOfLongestSubstring(self, s):
        if s=='':
            return 0
        maxlen=len(set(s))
        ans=1
        l=len(s)
        b={}
        b[0]=1
        last={}
        last[s[0]]=0
        for i in xrange(1,l):
            # pdb.set_trace()
            if (s[i] not in last) or (i-last[s[i]]>b[i-1]):
                b[i]=b[i-1]+1
            elif s[i] in last:
                b[i]=i-last[s[i]]
            else:
                b[i]=b[i-1]

            if ans<b[i]:
                ans=b[i]
            if b[i]==maxlen:
                return maxlen
            last[s[i]]=i
        # print s
        # pprint(b)
        return ans

    def lengthOfLongestSubstring3(self, s):
        if s=='':
            return 0
        maxlen=len(set(s))
        ans=1
        l=len(s)
        a={}
        a[s[0]]={}
        a[s[0]][0]=1
        b={}
        b[0]=1
        for i in xrange(1,l):
            if s[i] not in a:
                a[s[i]]={}
                a[s[i]][i]=1
            else:
                for j in xrange(i,-1,-1):
                    if j in a[s[i]]:
                        break
                for k in xrange(j,i):
                    a[s[i]][k]=a[s[i]][j]
                a[s[i]][i]=a[s[i]].get(j,0)+1

            if a[s[i]].get(i-1,None)==None or a[s[i]].get(i-1,None)==a[s[i]].get(i-1-b[i-1],None):
                b[i]=b[i-1]+1
            else:
                for j in xrange(i-1,-1,-1):
                    if s[i]==s[j]:
                        b[i]=i-j
                        break
            if ans<b[i]:
                ans=b[i]
            if b[i]==maxlen:
                return maxlen
        # print s
        # pprint(a)
        # pprint(b)
        return ans

    def lengthOfLongestSubstring2(self, s):
        if s=='':
            return 0
        maxlen=len(set(s))
        l=len(s)
        a={}
        for i in xrange(l):
            if s[i] not in a:
                a[s[i]]={}
                a[s[i]][i]=1
            else:
                for j in xrange(i,-1,-1):
                    if j in a[s[i]]:
                        break
                for k in xrange(j,i):
                    a[s[i]][k]=a[s[i]][j]
                a[s[i]][i]=a[s[i]].get(j,0)+1
        # print s
        # pprint(a)
        b={}
        b[0]=1
        for i in xrange(1,l):
            if a[s[i]].get(i-1,None)==None or a[s[i]].get(i,None)==a[s[i]].get(i-b[i-1],None):
                b[i]=b[i-1]+1
            else:
                b[i]=b[i-1]
            if b[i]==maxlen:
                return maxlen
        # pprint(b)
        return b[l-1]

    def lengthOfLongestSubstring1(self, s):
        if s=='':
            return 0
        abc=set()
        l=len(s)
        maxlen=1
        for i in xrange(l):
            letter=s[i]
            if letter not in abc:
                abc.add(letter)
                j1=i
                j2=i+1
                while j2<l:
                    if s[j2]==letter:
                        s2=s[j1:j2]
                        if len(set(s2))==len(s2):
                            if maxlen<len(s2):
                                maxlen=len(s2)
                        j1=j2
                        j2+=1
                    else:
                        s2=s[j1:j2+1]
                        if len(set(s2))==len(s2):
                            if maxlen<len(s2):
                                maxlen=len(s2)
                        j2+=1
        return maxlen

